import React from 'react';
import { useParams } from 'react-router';
import { Col, Container, Row } from 'reactstrap';
import { ORDER } from '../../assets/Json/ORDER';
import './OrderDetails.css';
const OrderDetails = (props) => {
  let param = useParams();
  const i = parseInt(param.id);
  const data = ORDER[i];
  console.log('data', data);
  console.log('orders');

  return (
    <Container>
      <h4 className='pt-4 pb-4'>Order Details</h4>
      <div className='cardDetials'>
        <h4 className='text-light p-3 distributorHeading'>
          {data.distributor}
        </h4>
        <Row className='px-3'>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Order ID
          </Col>
          <Col xs={9} sm={9} md={9} lg={6} xl={6} className='pb-1 text-light'>
            : {data.id}
          </Col>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Total Item
          </Col>
          <Col xs={9} sm={9} md={9} lg={2} xl={2} className='pb-1 text-light'>
            : {data.totalItem}
          </Col>
        </Row>
        <Row className='px-3'>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Order Date
          </Col>
          <Col xs={9} sm={9} md={9} lg={6} xl={6} className='pb-1 text-light'>
            : {data.date}
          </Col>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Amount
          </Col>
          <Col xs={9} sm={9} md={9} lg={2} xl={2} className='pb-1 text-light'>
            : {data.amount}
          </Col>
        </Row>
        <Row className='px-3 pb-4'>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Address
          </Col>
          <Col xs={9} sm={9} md={9} lg={6} xl={6} className='pb-1 text-light'>
            : {data.address}
          </Col>
          <Col xs={3} sm={3} md={3} lg={2} xl={2} className='pb-1 text-light'>
            Status
          </Col>
          <Col xs={9} sm={9} md={9} lg={2} xl={2} className='pb-1 text-light'>
            : {data.status}
          </Col>
        </Row>
      </div>
    </Container>
  );
};

export default OrderDetails;
